import React from "react";

export default () => {
    return (
        <>
            <form>
                <div className="form-group">
                    <label>Title</label>
                    <input className="form-control"/>
                </div>
                <br/>
                <button className="btn btn-primary">Submit</button>
            </form>
        </>
    )
}
